import './search.css';
import axios from 'axios';

class searchResults extends Component{
    render(){
        const headers = {
            '‘Ocp-Apim-Subscription-Key':'d70e0b68e0b246e9bb36efc7d644ccb0'
        }
        url = "https://api.cognitive.microsoft.com/bing/v7.0/suggestions?mkt=fr-FR&q=Tesla"
        axios.get(url, {headers:headers})
        .then(responseData => {
            console.log(responseData.data);})
        .catch(responseData=>{
            console.log("error");
        })
        return(
            <div>{this.props.location.state.searchWord}</div>
        )
    }
}

export default searchResults;
